ight\"}] [:p/html \"<h4>h4</h4><h5>h5</h5>\"]], \"5624\" [:div nil [:p/markdown \"We can ask for a tests summary:\"]], \"5617\" [:div [:p/code {:code \"(defmethod\\n  ^{:doc\\n    \\\"Example of user extensible kind.\\nNote the ':reload true' in the :require vector:\\n[notespace.kinds :as k :reload true].\\nThis will make REPL testing your extensible kind easier!\\\"}\\n  kind/kind->behaviour ::just-code\\n  [_]\\n  {:render-src?   true\\n   :value->hiccup (constantly nil)})\", :bg-class \"bg-light\"}] [:p/code {:code \"#multifn[kind->behaviour 0x4892eedb]\\n\"}]], \"5541\" [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]], \"5608\" [:div nil [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]], \"5588\" [:div nil [:p/markdown \"### math\"]], \"5535\" [:div nil [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-realize-note-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Notespace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line 14)` applies that to the note at line 14.\"]], \"5536\" [:div nil [:p/markdown \"#### eval-and-realize-notes-from-line\\n\\nUse `notespace.api/eval-and-realize-notes-from-line` to evaluate and realize all notes starting from a certain line, and inform Notespace.\"]], \"5582\" [:div nil [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]], \"5603\" [:div [:p/code {:code \"[:hiccup [:big [:big 3]]]\", :bg-class \"bg-light\"}] [:hiccup [:big [:big 3]]]], \"5622\" [:div [:p/code {:code \"(require '[midje.sweet :refer [fact]])\", :bg-class \"bg-light\"}] nil], \"5575\" [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}] nil], \"5556\" [:div nil [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]], \"5599\" [:div nil [:p/markdown \"--------------------\"]], \"5615\" [:div [:p/code {:code \"(-> {:description \\\"A simple bar chart with embedded data.\\\"\\n     :data        {:values [\\n                            {:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n                            {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n                            {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}\\n                            ]}\\n     :mark        :bar\\n     :encoding    {:x {:field :a :type :nominal :axis {:labelAngle 0}}\\n                   :y {:field :b :type :quantitative}}}\\n    (kind/override kind/vega))\", :bg-class \"bg-light\"}] [:p/vega {:description \"A simple bar chart with embedded data.\", :data {:values [{:a \"A\", :b 28} {:a \"B\", :b 55} {:a \"C\", :b 43} {:a \"D\", :b 91} {:a \"E\", :b 81} {:a \"F\", :b 53} {:a \"G\", :b 19} {:a \"H\", :b 87} {:a \"I\", :b 52}]}, :mark :bar, :encoding {:x {:field :a, :type :nominal, :axis {:labelAngle 0}}, :y {:field :b, :type :quantitative}}}]], \"5534\" [:div nil [:p/markdown \"#### eval-and-realize-this-notespace\\n\\nUse `notespace.api/eval-and-realize-this-notespace` to evaluate all notes in the current namespace sequentially, one note after another, and then realize them in the background. As always, Notespace is informed about the results.\"]], \"5618\" [:div [:p/code {:code \"(def ^{:doc \\\"When making a user extensible kind, you MUST assign the keyword\\nto a variable. Annotating with a keyword WILL NOT WORK!\\\"} just-code ::just-code)\", :bg-class \"bg-light\"}] nil], \"5578\" [:div nil [:p/markdown \"### vega\"]], \"5540\" [:div nil [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` or `notespace.api/eval-and-realize-this-notespace` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]], \"5604\" [:div nil [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]], \"5567\" [:div nil [:p/markdown \"* a\\n* b\\n* c\\n* d\"]], \"5581\" [:div nil [:p/markdown \"### code\"]], \"5544\" [:div nil [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]], \"5616\" [:div nil [:p/markdown \"## Extending Notespace with new note kinds.\"]], \"5553\" [:div nil [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]], \"5526\" [:div nil [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]], \"5589\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/math\\n \\\"(ax ^2 + bx + c = 0 )\\\"]\", :bg-class \"bg-light\"}] [:p/math \"(ax ^2 + bx + c = 0 )\"]], \"5620\" [:div [:p/code {:code \"^just-code\\n[:div \\\"just some code\\\"]\", :bg-class \"bg-light\"}] nil], \"5611\" [:div [:p/code {:code \"(comment\\n  (notespace/update-config #(assoc % :evaluation-callback-fn\\n                             (fn [idx note-count note]\\n                               (let [expected-duration (or  (get-in note [:duration]) 0)]\\n                                 (println \\\"evaluate note: \\\" idx \\\"/\\\" (dec note-count)\\n                                          \\\", expected duration (s): \\\"\\n                                          (if (pos? expected-duration)\\n                                            expected-duration\\n                                            \\\"???\\\"))))))\\n\\n  (notespace/update-config #(assoc % :in-eval-count-down-fn\\n                           (fn [seconds]\\n                             (println seconds))))\\n  (reset! state/the-context\\n          (fx/swap-context @state/the-context\\n                           #(-> % (assoc-in [:config :render-src?] false)))))\", :bg-class \"bg-light\"}] [:p/code {:code \"nil\\n\"}]], \"5610\" [:div nil [:p/markdown \"## Progress logging\\n\\nThis should be documented better soon.\"]], \"5592\" [:div nil [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a dataset that prints nicely as a table in markdown (for exaple, a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries).\\n\\nIt wraps the resulting markdown with nice Bootstrap CSS classes, so that the table is displayed nicely.\\n\\nWe do not have an example here, since that would require depending on the above libraries.\"]], \"5573\" [:div [:p/code {:code \"^kind/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data (-0.3574421219528282 -0.6058118399574093 -0.7021160053957427 -0.7601786073074828 -1.1179112179457051 -1.1914092944601538 -1.3648342011566248 -1.539987838882484 -1.533749372986609 -1.1359961148022117 -1.4501597573572638 -1.2104983575447066 -1.417320720682362 -1.7927999337641882 -1.958805166456011 -2.322016 -family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:p/code {:code \"(-0.06243875390864484\\n 0.3420798665211582\\n 0.7275252852592311\\n 1.0712669308031244\\n 0.5888884966737914\\n 1.0591249940079626\\n 1.3798563364112\\n 1.2778019621298378\\n 1.3274628648619293)\\n\"}]]], \"5570\" [:div nil [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]], \"5547\" [:div nil [:p/markdown \"If a note's value is an atom, then Notespace will be informed when its value changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]], \"5530\" [:div [:p/code {:code \"(deref d2)\", :bg-class \"bg-light\"}] [:p/code {:code \"12\\n\"}]], \"5584\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/code \\\"def abcd(x):\\n  return x+9\\\"\\n {:language :python}]\", :bg-class \"bg-light\"}] [:p/code \"def abcd(x):\\n  return x+9\" {:language :python}]], \"5571\" [:div nil [:big [:big 3]]], \"5577\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:p/player {:width \"100%\", :height \"100%\", :url \"https://www.youtube.com/watch?v=G512fvK9KXA\"}]], \"5532\" [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:p/code {:code \"12\\n\"}]]], \"5561\" [:div nil [:p/markdown \"### hidden\\n\\nA `:hidden` note does not render its value, and also does not show its code.\\n\\nHere is a note that you cannot see:\"]], \"5551\" [:div [:p/code {:code \"^kind/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] nil], \"5537\" [:div nil [:p/markdown \"#### eval-and-realize-notes-from-change\\n\\n Use `notespace.api/eval-and-realize-notes-from-change` to evaluate and realize all notes starting from the line where the file has changed in its last save, compared to the previous save.\"]], \"5568\" [:div nil [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]], \"5546\" [:div nil [:p/markdown \"### Atoms\"]], \"5614\" [:div [:p/code {:code \"(-> [\\\"(ax ^2 + bx + c = 0 )\\\"]\\n    (kind/override kind/math))\", :bg-class \"bg-light\"}] [:div [:p/math \"(ax ^2 + bx + c = 0 )\"]]], \"5543\" [:div nil [:p/markdown \"### Futures\"]], \"5522\" [:div nil [:p/markdown \"## Notes\\n\\nHere is a note:\"]], \"5609\" [:div nil [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]], \"5565\" [:div [:p/code {:code \"^kind/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]], \"5560\" [:div [:p/code {:code \"^kind/void\\n(+ 1 2)\", :bg-class \"bg-light\"}] nil], \"5607\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:p/code {:code \"3\\n\"}]], \"5554\" [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}] nil], \"5585\" [:div nil [:p/markdown \"Such tags can usually be handled through dedicated kinds too.\"]], \"5563\" [:div nil [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]], \"5619\" [:div nil [:p/markdown \"An example of properly annotated form with a variable that resolves to a keyword which is attached to a kind->behavior method:\"]], \"5557\" [:div [:p/code {:code \"^kind/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:p/code {:code \"((5 3 0 4 0 0)\\n (3 2 5 4 5 2)\\n (0 4 1 0 4 4)\\n (2 2 4 1 3 3)\\n (2 3 1 4 3 3)\\n (2 5 3 0 2 2))\\n\"}]], \"5591\" [:div [:p/code {:code \"^kind/math\\n(str \\\"(ax ^2 \\\"\\n     \\\"+ bx \\\"\\n     \\\"+ c \\\"\\n     \\\" = 0)\\\")\", :bg-class \"bg-light\"}] [:p/math \"(ax ^2 + bx + c  = 0)\"]], \"5559\" [:div nil [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]], \"5523\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:p/code {:code \"21\\n\"}]], \"5600\" [:div nil [:p/markdown \"### Plain html\"]], \"5598\" [:div [:p/code {:code \"^kind/dataset-grid\\n[{:a 1 :b 4}\\n {:a 2 :b 5}\\n {:a 3 :b 6}]\", :bg-class \"bg-light\"}] [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]], \"5625\" [:div [:p/code {:code \"^kind/hiccup\\n(notespace/midje-summary)\", :bg-class \"bg-light\"}] [:div [:div \"Tests summary:\" [:div [:big [:big {:style {:color \"darkgreen\"}} \"✓\"]] \": \" 1]]]], \"5612\" [:div nil [:p/markdown \"## Overriding note kinds at runtime\\nIt is possible to override a note's kind during its evaluation using the `notespace.kinds/override` functions.\"]], \"5572\" [:div nil [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]], \"5555\" [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:big [:big 3]]], \"5605\" [:div nil [:p/markdown \"Notes which are forms like `(def ...)` or `(defn ...)` are assigned the kind `:void`.\"]], \"5525\" [:div nil [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]], \"5597\" [:div nil [:p/markdown \"--------------------\"]], \"5524\" [:div nil [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]], \"5549\" [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:div [:p/code {:code \"a\", :bg-class \"bg-light\"}] [:p/code {:code \"{:x 3}\\n\"}]]], \"5579\" [:div nil [:p/markdown \"The `vega` kind supports both Vega and Vega-Lite visualizations.\"]], \"5564\" [:div [:p/code {:code \"^kind/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]], \"5606\" [:div nil [:p/markdown \"All other notes witn no explicit metadata are assigned the kind `:naive` automatically.\"]], \"5539\" [:div nil [:p/markdown \"### Delays\"]], \"5621\" [:div nil [:p/markdown \"## Midje tests\\n\\nTests of the Midje test framework are rendered as follows:\"]], \"5531\" [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(delay - not running yet ...)\"]], \"5580\" [:div [:p/code {:code \"^kind/vega\\n{\\n 72851645681953 0.9155233653529575 0.7334452613574383 -0.8038949630683346 -0.19154010207448616 1.1069762211474494 0.20328122207534294 -0.9810504710772916 0.3428401653179595 0.924500203957227 -0.4697473208865056 -0.7414664033919619 0.9383043173930167 0.6740431569534195 -0.7810252094979493 -0.15297525962684044 1.188583224259797 0.017532736772077923 -0.7969227386892024 0.3038770987970404 1.078367281135002 -0.5237065684170185 -0.6909215676217451 0.9034118243593044 0.6978653808333345 -0.8392188493530175 -0.12287493493532044 1.1520676857959828 0.11439514364463936 -0.7836971799898507 0.3934373122346414 0.8907439588158786 -0.46983521445358184 -0.6466252553245819 0.9830242113538105 0.6359732906384217 -0.887410218339966), :limit 100, :svgWidth 100, :svgHeight 20}]]]], \"5602\" [:div nil [:p/markdown \"## Other ways to specify note kinds\\n\\nA note's kinds can also be specified by including it in a vector beginning with a keyword. This is inspired by the approach of [Oz](https://github.com/metasoarous/oz), and should allow some partial compatibility with Oz notebooks.\"]], \"5533\" [:div nil [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]], \"5538\" [:div nil [:p/markdown \"### Listening to changes\\n\\n`(notespace.api/listen)` will tell Notespace to listen to changes in the file corresponding to the current namespace (on a file save). When changes occur, (notespace.api/eval-and-realize-notes-from-change) is called. This results in an [Oz](https://github.com/metasoarous/oz)-like live-reload experience.\\n\\n`(notespace.api/unlisten)` will tell Notespace to stop listening to the current namespace.\"]], \"5583\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/code \\\"(defn abcd [x] (+ x 9))\\\"]\", :bg-class \"bg-light\"}] [:p/code \"(defn abcd [x] (+ x 9))\"]], \"5550\" [:div nil [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]], \"5593\" [:div nil [:p/markdown \"### dataset-grid\\n\\nNotes of kind `:dataset-grid` are expecting a value which is one of the following:\\n- a map, whose values are same-length sequentials (one example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries);\\n- a sequence of maps.\\n\\nThey render that values as an [ag-Grid](https://www.ag-grid.com/) table view.\\n\\nFor example:\"]], \"5587\" [:div [:p/code {:code \"^kind/code\\n(pr-str '(defn abcd [x] (+ x 9)))\", :bg-class \"bg-light\"}] [:p/code \"(defn abcd [x] (+ x 9))\"]], \"5595\" [:div nil [:p/markdown \"--------------------\"]], \"5590\" [:div [:p/code {:code \"^kind/math\\n[\\\"(ax ^2 + bx + c = 0 )\\\"\\n \\\"(dx ^2 + ex + f = 0 )\\\"]\", :bg-class \"bg-light\"}] [:div [:p/math \"(ax ^2 + bx + c = 0 )\"] [:p/math \"(dx ^2 + ex + f = 0 )\"]]], \"5529\" [:div [:p/code {:code \"(def d2 (delay 12))\", :bg-class \"bg-light\"}] nil], \"5552\" [:div nil [:p/markdown \"### Promises\\nComing soon.\"]], \"5558\" [:div nil [:p/markdown \"This is the default kind, so usually there is no need to mention it.\"]], \"5548\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] nil], \"5594\" [:div [:p/code {:code \"^kind/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData ({\"x\" 0, \"y\" 0.9754941972358191, \"z\" \\a} {\"x\" 1, \"y\" 0.7068954946199212, \"z\" \\b} {\"x\" 2, \"y\" 0.6961757924235755, \"z\" \\c} {\"x\" 3, \"y\" 0.7086201184893324, \"z\" \\a} {\"x\" 4, \"y\" 0.7974800798732637, \"z\" \\b} {\"x\" 5, \"y\" 0.31597231823204397, \"z\" \\c} {\"x\" 6, \"y\" 0.9381942554790076, \"z\" \\a} {\"x\" 7, \"y\" 0.6044048191895968, \"z\" \\b} {\"x\" 8, \"y\" 0.41417722334828233, \"z\" \\c})}]]], \"5527\" [:div nil [:p/markdown \"## References\\n\\nClojure references such as delays, futures, promises and atoms are handled by Notespace in a special way. Below we will see how Notespace offers ways to bring the dynamic REPL experience of such constructs to the dynamic browser view.\\n\\n### The rule of rendering\\n\\nAssume that a note's evaluation result `x` is a reference.\\n\\nIf `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. In the rendering value, this is marked by `(dereferenced)`.\\n\\nOtherwise, you should see a mark that says it is still pending.\\n\\n\\nFor example:\"]], \"5613\" [:div [:p/code {:code \"(-> [:div [:big [:big 3]]]\\n    (kind/override kind/hiccup))\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"5528\" [:div [:p/code {:code \"(def d1 (delay 11))\", :bg-class \"bg-light\"}] nil], \"5586\" [:div [:p/code {:code \"^kind/code\\n[\\\"(defn abcd [x] (+ x 9))\\\"\\n \\\"(defn abcd [x] (+ x 3))\\\"]\", :bg-class \"bg-light\"}] [:div [:p/code \"(defn abcd [x] (+ x 9))\"] [:p/code \"(defn abcd [x] (+ x 3))\"]]]}}");
